import React from "react";

const Employeregister = () => {
  return (
    <>
      <div className="empcont">
        <div className="row">
          <div className="col-6">
            <lable>name</lable>
            <input type="text" />
            <lable>Date of birth</lable>
            <input type="date" />
            <lable>mobile</lable>
            <input type="number" />
            <lable>Email</lable>
            <input type="email" />
            <lable>Address</lable>
            <textarea />
          </div>
          <div className="col-6"></div>
        </div>
      </div>
    </>
  );
};

export default Employeregister;
